nvalid cookie.'=>'Cookie non valide.','put your unique phrase here'=>'mettez une phrase unique ici','Could not update the email last sent time.'=>'Impossible de mettre à jour l’heure de dernier envoi du courriel.','The email could not be sent. Possible reason: your host may have disabled the %s function.'=>'Le courriel n’a pas pu être envoyé. Raison possible : votre hébergeur peut avoir désactivé la fonction %s.','A recovery link was already sent %1$s ago. Please wait another %2$s before requesting a new email.'=>'Un lien de récupération a déjà été envoyé il y a %1$s. Merci d’attendre %2$s avant de demander un l’envoi d’un nouveau courriel.','Error Details'=>'Détails de l’erreur','Please contact your host for assistance with investigating this issue further.'=>'Merci de contacter votre hébergeur pour une assistance concernant la résolution de ce problème.','Howdy!

Retraceur has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, Retraceur now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Bonjour !

Retraceur dispose d’une fonctionnalité native permettant de détecter si une extension ou un thème cause une erreur fatale sur votre site, et vous en informe avec ce courriel automatique.

###CAUSE###
Commencez par visiter votre site (###SITEURL###) pour vérifier s’il y a des problèmes visibles. Ensuite, visitez la page où une erreur a été relevée (###PAGEURL###) et vérifiez si des problèmes sont visibles.

###SUPPORT###

Si votre site semble cassé ou si vous ne pouvez pas accéder à votre tableau de bord normalement, Retraceur dispose maintenant d’un « mode de récupération ». Cela vous permet de vous connecter en sécurité sur votre tableau de bord afin de chercher la source du problème.

###LINK###

Pour garder votre site en sécurité, ce lien expirera dans ###EXPIRES###. Ne vous inquiétez cependant pas : un nouveau lien vous sera envoyé si l’erreur se présente à nouveau.

Si vous cherchez de l’aide pour ce problème, les informations suivantes pourraient vous être demandées :
